import React from 'react';
import { Text, View } from 'react-native';
import Detail from '../components/items/Detail';
import AppText from '../components/text/AppText';
import colors from '../styles/colors';
import { styles } from '../styles/styles';

const StoreDetails = () => {
    const { bg_light, container, my_10, p_15 } = styles;
    const { darkGrey } = colors;

    return (
        <View style={[bg_light, container, p_15]}>

            <Detail title="Account Number" value='accountNumber' />
            <Detail title="Slot Number" value='slotNumber' />
            <Detail title="Size" value='size' />
            <Detail title="Rental Fee" value='rentalFee' />
            <Detail title="Start Date" value='startDate' />
            <Detail title="End Date" value='endDate' />


            <View style={my_10}>
                <AppText as="h5" bold color={darkGrey} >Slot Number</AppText>
                <AppText>slotNumber</AppText>
            </View>


        </View>
    );
}

export default StoreDetails;
